B.alc=new A.X('TurnoMaki es un web para la gesti\xf3n de las solicitudes de cambio de, y solo de, los maquinistas.\n\n"Pues a mi me sale como si fuera una app..." \xa1Calla! Es una web, y punto. Lo vas a saber t\xfa mejor que nosotros. Que te salga como una app es... magia. Y, como web que es, puedes entrar a ella desde el m\xf3vil, la tablet o el ordenador. Si tiene un navegador web, puede entrar.\n\nLa web est\xe1 controlada totalmente por los administradores (maquinistas, igual que t\xfa) y no es accesible por nadie externo. Mucho menos la empresa.',null,null,null,null,null,null,null,null,null)
