B.al2=new A.X('Como bien dec\xeda el fil\xf3sofo Murphy "Shit Happens" o, en castellano, "Si algo puede salir mal, saldr\xe1 mal"\n\nSi has cargado tu PAS estar\xeda bien que revisaras que lo ha hecho correctamente. Porque una vez al a\xf1o no hace da\xf1o.\n\nSi ves que el servicio de Telegram no te envia todas las solicitudes que deber\xeda, avisa a un administrador. A\xfan no sabemos si tiene alg\xfan tipo de limitaci\xf3n y, cuanto antes lo comprobemos, antes buscaremos una alternativa.\n\nAnte v\xe1ndalos, graciosos y maleantes tenemos un sistema de recuperaci\xf3n de solicitudes. Y, si has sido t\xfa, lo sabremos.',null,null,null,null,null,null,null,null,null)
